import React from "react";
import "./styles.css";
import Emoji from "react-svg-emoji-local/emoji";

export default function App() {
  return (
    <div className="App">
      <Emoji/>
      <h1>Hello CodeSandbox</h1>
      <h2>Start editing to see some magic happen!</h2>
    </div>
  );
}
